      // }, {
      //   headers: {
      //     'Content-Type': 'multipart/form-data'
      //   }
      // }
    );
  }
  getItems() {
    return axios.get(ITEMES_BASE_GET_URL);
  }
  uploadImages(image) {
    return axios.post(IMAGES_BASE_POST_URL, image);
  }
}
export default new Services();
